n_qubits = 135
print(f"Number of stabilizers: {len(stabilizers)}")
print(f"Number of qubits: {n_qubits}")

# Convert to stim.PauliString
pauli_strings = []
for s in stabilizers:
    ps = stim.PauliString(s)
    pauli_strings.append(ps)

# Check commutativity
print("\nChecking commutativity...")
non_commuting = []
for i in range(len(pauli_strings)):
    for j in range(i+1, len(pauli_strings)):
        if not pauli_strings[i].commutes(pauli_strings[j]):
            non_commuting.append((i, j))

if non_commuting:
    print(f"Non-commuting pairs: {non_commuting[:10]}...")
else:
    print("All stabilizers commute!")

# Try to generate circuit using Stim's from_stabilizers
try:
    tableau = stim.Tableau.from_stabilizers(
        pauli_strings,
        allow_redundant=True,
        allow_underconstrained=True
    )
    circuit = tableau.to_circuit(method='elimination')
    print(f"\nCircuit generated successfully!")
    print(f"Circuit has {len(circuit)} operations")
    
    # Save circuit
    with open(r"data\claude-opus-4.6\agent_files\circuit_135.stim", "w") as f:
        f.write(str(circuit))
    print("Circuit saved to circuit_135.stim")
except Exception as e:
    print(f"Error generating circuit: {e}")
